import React from 'react';
import "./Inicio.css"; 
import Menu from "../../Menu";
import Header from '../../Header';

const Inicio = () => {

  return (
    <div className="container">
       
    <Menu />
    <div className="item item1-2"><Header/></div>
    <div className="item item2-1">Text</div>
    <div className="item item2-2">Text2</div>
    <div className="item item2-3">Text3</div>
    <div className="item item2-4">Text4</div>
    <div className="item item2-5">Text5</div>
    <div className="item item2-6">Text6</div>
    <div className="item item2-7">Text7</div>
  </div>

  );
};

export default Inicio;
